        if (type == ""text"") {
            $(`#txtAnswer${option}`).show();
            $(`.uploadAnswer${option}`).hide();
        }
        else {
            $(`#txtAnswer${option}`).hide();
            $(`.uploadAnswer${option}`).show();
        }
